};

// Obtener llaves del objeto Data
var Canal = Object.keys(Data);
// Declaración del string con 
var canalmsg;

//Objeto con las funciones del CILA2S
var FuncionC2S = {
    "CILA2S en marcha"          : global.get("IO.Functions.DO['CILA2S en marcha']",'memoryOnly')||false,
    "Falla general"             : global.get("IO.Functions.DO['Falla general']",'memoryOnly') || false,
