    "Simulación"                : false
}

// Llaves del vector FuncionesC2S
var Keys = Object.keys(FuncionC2S);

// Para cada canal de salida
for(var i=0; i <Canal.length; i++){
    canalmsg ='Canal'+ Canal[i];
    // Si la configuración del canal está declarada
    if(typeof ES.SD[canalmsg] != 'undefined'){
        // Para cada llave del vector FuncionesC2S que coincida con la configuración del canal
        for(var j=0; j<Keys.length; j++){
            if(ES.SD[canalmsg].Funcion == Keys[j]){
                // Asignar el valor contenido en el vector de funciones al canal de salida
                Data[Canal[i]] = ES.SD[canalmsg].Tipo == "NO" ? FuncionC2S[Keys[j]]:!FuncionC2S[Keys[j]];
            } 
        }
    }
}

// Asignar variable con los valores a escribir  (Se puede eliminar al asignar directamente).
